import React, {useState} from 'react';
import './NavBar.scss';
import { Link, animateScroll as scroll } from "react-scroll";

function NavBar() {
    const [clicked, setClicked] = useState(false);

    return (
        <div>
            <ul>
            <Link
                activeClass="active"
                to="Popular"
                spy={true}
                offset={-30}
                onClick={() => setClicked(!clicked)}
            >
                <li>Popular</li>
            </Link>
            <Link
                activeClass="active"
                to="Recent"
                spy={true}
                offset={-30}
                onClick={() => setClicked(!clicked)}
            >
                <li>Recent</li>
            </Link>
            <Link
                activeClass="active"
                to="Upvoted"
                spy={true}
                offset={-30}
                onClick={() => setClicked(!clicked)}
            >
                <li>Upvoted</li>
            </Link>
            <Link
                activeClass="active"
                to="Discussed"
                spy={true}
                onClick={() => setClicked(!clicked)}
            >
                <li>Discussed</li>
            </Link>
            </ul>
        </div>
    )
}

export default NavBar
